import DeleteIcon from '@mui/icons-material/Delete';

const Listcom = (props)=>{
return (
    <div className='todo_style'>
        <span>
        <DeleteIcon className='deleteIcon'/>
        </span >
        <li style={{textDecoration:"line-through"}}>{props.text}</li>
    </div>
)
};
export default Listcom;
